	OR ( modal_usaha_siu = '0' ) 
	OR ( modal_usaha_siu = '' ),
IF
	( ( nomor_siu IS NULL ) OR ( nomor_siu = '0' ) OR ( nomor_siu = '' ), '', '-None-' ),
	modal_usaha_siu 
	) AS modal_usaha_siu,
IF
	(
	( grade_siu IS NULL ) 
	OR ( grade_siu = '0' ) 
	OR ( grade_siu = '' ),
IF
	( ( nomor_siu IS NULL ) OR ( nomor_siu = '0' ) OR ( nomor_siu = '' ), '', '-None-' ),
	grade_siu 
	) AS grade_siu,
	file_siu 
FROM
	tvd_list 
ORDER BY
	id ASC ;
