INSERT INTO `epi_vdl`.`tl_siujk_detil` (`id`,`kode_klasifikasi`,`kode_sub`,`sub_klasifikasi`,`lingkup`) VALUES (1, 'A', 'BG001', 'Jasa Pelaksana Konstruksi Bangunan Hunian Tunggal dan Kopel', 'Pekerjaan Pelaksanaan (termasuk didalamnya  pembangunan baru,penambahan, serta peningkatan)dari bangunan perumahan yang terdiri dari satu atau dua tempat tinggal maksimum 2 lantai.'),(2, 'A', 'BG002', 'Jasa Pelaksana Konstruksi Bangunan Multi atau Banyak Hunian', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan serta peningkatan)dari bangunan perumahan bertingkat tinggi yang lebih dari 2 lantai.'),(3, 'A', 'BG003', 'Jasa PelaksanaKonstruksiBangunan Gudang dan Industri', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru,penambahan, peningkatan serta pekerjaan renovasi) dari bangunan gudang dan bangunan Industri.'),(4, 'A', 'BG004', 'Jasa Pelaksana Konstruksi Bangunan Komersial', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan, peningkatan serta pekerjaan renovasi) dari bangunan dengan tujuan komersial seperti bangunan perkantoran, bangunan BANK, Garasi parkir, stasiun pengisian bahan bakar, terminal kendaraan umum serta bangunan stasiun kereta api, bangunan pusat perbelanjaan.'),(5, 'A', 'BG005', 'Jasa PelaksanaKonstruksi Bangunan Hiburan Publik', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru,penambahan, peningkatan sertapekerjaan renovasi) dari bangunan hiburan publik seperti bioskop, hallkonser, nightclubs.'),(6, 'A', 'BG006', 'Jasa PelaksanaKonstruksiBangunan Hotel, Restoran, dan Bangunan Serupa Lainnya', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru,penambahan, peningkatan serta pekerjaan renovasi) dari hotel, motel, restoran dan bangunan yang serupa lainnya.'),(7, 'A', 'BG007', 'Jasa Pelaksana Konstruksi BangunanPendidikan', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan, peningkatan sertapekerjaan renovasi) dari bangunan pendidikan seperti sekolah, universitas, perpustakaan dan museum termasuk jugalaboratorium penelitian.'),(8, 'A', 'BG008', 'Jasa PelaksanaKonstruksiBangunanKesehatan', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru,penambahan, peningkatan serta pekerjaan renovasi) dari bangunan kesehatan seperti rumah sakit dan sanotarium.'),(9, 'A', 'BG009', 'Jasa Pelaksana Untuk Konstruksi Bangunan Gedung Lainnya', 'Pekerjaan Pelaksanaan (termasuk didalamnya pembangunan baru, penambahan, peningkatan sertapekerjaan renovasi) dari bangunan lainnya seperti, rumah ibadah dan penjara'),(10, 'B', 'SI001', 'Jasa Pelaksana Konstruksi Saluran Air, Pelabuhan, Dam, dan Prasarana Sumber Daya Air Lainnya', '1.   Pekerjaan pelaksanaan pembangunan, pemeliharaan dan perbaikan bangunan bendungan (dam), bendung (weir), embung, pintu air, talang, check dam, tanggul dan saluran pengendali banjir termasuk drainase perkotaan beserta bangunan pelengkapnya, tanggul laut, krib, waduk dan sarana dan/atau prasarana sumber daya air lainnya;2.    Pekerjaan pelaksanaan pembangunan, pemeliharaandan perbaikan konstruksijaringan saluran air, sistem irigrasi (kanal), reservoir(waduk) dan drainase irigrasi;dan3.    Pekerjaan pelaksanaan pembangunan, pemeliharaandan perbaikan dermaga, sarana pelabuhan, penahan gelombang dan sejenisnya. Termasuk konstruksi jalan air atauterusan, pelabuhan dan sarana jalur sungai, dok (pangkalan), lock (panama canal lock, Hoover Dam) dan lain-lain'),(11, 'B', 'SI002', 'Jasa Pelaksana Konstruksi InstalasiPengolahan Air Minum dan Air Limbah serta BangunanPengolahanSampah', 'Pekerjaan pelaksanaan pembangunan, pemeliharaan dan perbaikan instalasi pengolahan airminum, bangunan menara air dan reservoir air beserta bangunan pelengkap air minum lainnya, instalasi pengolahan air limbahbeserta bangunan pelengkap air limbah lainnya, bangunan Tempat Pembuangan Akhir Sampah beserta bangunan pelengkap lainnya.'),(12, 'B', 'SI003', 'Jasa Pelaksana Konstruksi Jalan Raya (kecuali Jalan Layang),Jalan, Rel Kereta Api, dan Landas Pacu Bandara', 'Pekerjaan pelaksanaan pembangunan, peningkatan, pemeliharaan dan perbaikan jalan. Jalan raya (kecuali Jalan Layang)dan jalan tol termasuk juga jalan untuk pejalan kaki, rel kereta api, dan landas pacu bandara.'),(13, 'B', 'SI004', 'Jasa Pelaksana Konstruksi Jembatan, Jalan Layang, Terowongan dan Subway', '1.      Pekerjaan pelaksanaan pembangunan, peningkatan, pemeliharaan dan perbaikan jembatan dan jalan layang; dan2.      Pelaksanaan pembangunan, peningkatan, pemeliharaan dan perbaikan pembangunan terowongaan di bawahpermukaan air, di bukit atau pegunungan dan di bawah permukaan tanah.'),(14, 'B', 'SI005', 'Jasa Pelaksana Konstruksi Perpipaan Air Minum Jarak Jauh', 'Pekerjaan pelaksana instalasi, peningkatan, pemeliharaan dan perbaikan jaringan pipa untuk distribusi air bersih jarak jauh antar pulau dan/atau bawah permukaan laut'),(15, 'B', 'SI006', 'Jasa PelaksanaKonstruksi Perpiaan Air Limbah Jarak Jauh', 'Pekerjaan pelaksana instalasi, peningkatan, pemeliharaan danperbaikan jaringan pipa untukdistribusi air limbah jarak jauh antar pulau dan/atau bawah permukaanlaut'),(16, 'B', 'SI007', 'Jasa PelaksanaKonstruksiPerpiaan Minyak dan Gas Jarak Jauh', 'Pekerjaan pelaksana instalasi, peningkatan, pemeliharaan danperbaikan pipa jaringan untuk distribusi minyak dan gas jarak jauh antar pulau dan/atau bawah permukaan laut'),(17, 'B', 'SI008', 'Jasa Pelaksana Konstruksi Perpiaan Air Minum Lokal', 'Pekerjaan pelaksana instalasi, peningkatan, pemeliharaan dan perbaikan jaringan pipa untuk distribusi air minum yang bersifat lokal dan untuk jarak yang dekat'),(18, 'B', 'SI009', 'Jasa Pelaksana Konstruksi Perpiaan AirLimbah Lokal', 'Pekerjaan pelaksana instalasi, peningkatan, pemeliharaan dan perbaikan jaringan pipa untukdistribusi air limbah yang bersifat lokal dan untuk jarak yang dekat'),(19, 'B', 'SI010', 'Jasa Pelaksana Konstruksi Perpiaan Minyak dan Gas Lokal', 'Pekerjaan pelaksana instalasi, peningkatan, pemeliharaan dan perbaikan jaringan pipa untuk distribusi air minyak dan gas yang bersifat lokal dan untuk jarak yang dekat'),(20, 'B', 'SI011', 'Jasa PelaksanaPekerjaan Bangunan Stadion untuk Olah Raga outdoor', 'Pekerjaan pelaksana untuk konstruksi stadion dan olah ragalapangan yang biasanya dimainkan di tempat terbuka (open air) sepertisepakboola, baseball, rugby,lintasan balap mobil dan motor serta lintasan pacu kuda'),(21, 'B', 'SI012', 'Jasa PelaksanaKonstruksiBangunan Fasilitas Olah Raga Indoor dan Fasilitas Rekreasi', 'Pekerjaan pelaksana untuk olahraga lainnya serta instalasifasilitas rekreasi, olah raga yang dimaksud lebih banyak merupakan olah raga indoor  yangmembutuhkan ruang yang lebih kecil untuk penonton seperti lapangann basket, hockey,lapangan tenis, hall senam, dan ring tinju dan fasilitas taman rekreasi.'),(22, 'C', 'MK001', 'Jasa Pelaksana Konstruksi Pemasangan Pendingin Udara (Air Conditioner), Pemanas dan Ventilasi', 'Pekerjaan pelaksana pemasangan dan perawataan yang meliputi pemanasan elektrik maupun non- elektrik, ventilasi, lemari pendingin, atau peralatan AC, pekerjaan ducting dan pekerjaan metal lembaran yang dilakukan secara terintegrasi dari pekerjaan tersebut.'),(23, 'C', 'MK002', 'Jasa PelaksanaKonstruksiPemasangan Pipa Air (Plumbing) Dalam Bangunan Dan Salurannya', 'Pekerjaan pelaksana pemasangan dab perawatan yang meliputi:1.      Sistem perpipaan utama air panas dan dingin, instalasi sprinkler, pipa air kotor, pipa air drain;2.      Perlengkapan sprinkler; dan3.      Sistem pemadam kebakaran..'),(24, 'C', 'MK003', 'Jasa PelaksanaKonstruksi Pemasangan Pipa Gas Dalam Bangunan', 'Pekerjaan pelaksana pemasangan dan perawatan pipa untuk gas,oksigen, di rumah sakit danperalatan pengoperasian gas lainnya'),(25, 'C', 'MK004', 'Jasa Pelaksana Konstruksi Insulasi DalamBangunan', 'Pekerjaan pelaksana pemasangan dan perawatan yang meliputi:1.      Insulasi thermal termasukbahan isolasi penahan panas untuuk dinding luar;2.      Insulasi thermal untuk pipa air panas dan dingin, ketel uapdan saluran pembuangan;3.      Insulasi suara; dan4.      Insulasi anti kebakaan.'),(26, 'C', 'MK005', 'Jasa PelaksanaKonstruksi Pemasangan Lift Dan Tangga Berjalan', 'Pekerjaan konstruksi pemasangan lift dan ekskalator serta jalanpejalan kaki yang dapat bergerakjuga termasuk pekerjaan konstruksi perlengkapan keselamatan darikebakaran (contohnya tangga darurat)'),(27, 'C', 'MK006', 'Jasa PelaksanaKonstruksi Pertambangan dan Manufaktur', 'Pekerjaan pelaksana pemasangan dan perawaatan fasilitaspertambangan dan manufaktur termasuk seperti loading anddischarging statios, winding shafts,chemical plants, iron foundaries, blast furnaces dan coke oven.'),(28, 'C', 'MK007', 'Jasa PelaksanaKonstruksi Instalasi Thermal, Bertekanan, Minyak, Gas, Geothermal (Pekerjaan Rekayasa)', 'Pekerjaan pelaksana pemasangan dan perawatan dari:1.   anjungan lepas pantai(platform); dan2.   fasilitas produksi, penyimpanan minyak dan gas lainnya.'),(29, 'C', 'MK008', 'Jasa Pelaksana Konstruksi Instalasi Alat Angkut dan Alat Angkat', 'Pekerjaan pelaksana pemasangan dan perawatan dari konstruksi alat angkut dan angkat serta conveyor.'),(30, 'C', 'MK009', 'Jasa Pelaksana Konstruksi Instalasi Perpipaan, Gas, Energi (Pekerjaan Rekayasa)', 'Pekerjaan pelaksana pemasangan dan perawatan dari:1.    pipa minyak, gas dan energi di darat; dan2.    pipa minyak, gas dan energi di bawah laut.'),(31, 'C', 'MK010', 'Jasa Pelaksana Instalasi Fasilitas Produksi, Penyimpanan Minyak Dan Gas (Pekerjaan Rekayasa)', 'Pekerjaan pelaksana pemasangan dan perawatan dari:1.   fabrikasi fasilitas produksi, penyimpanan minyak dan gasdidarat dan lepas pantai;2.   fabrikasi bejana tekan (pressure vessel) dan tangki;3.    fabrikasi boiler; dan4.   fabrikasi module.'),(32, 'C', 'EL001', 'Jasa Pelaksana Konstruksi Instalasi Pembangkit Tenaga Listrik Semua Daya', 'Pekerjaan pemasangan dan perawatan elektromekanik dan kelistrikan pembangkit tenaga listriksemua daya.'),(33, 'C', 'EL002', 'Jasa Pelaksana KonstruksiInstalasi Pembangkit Tenaga Litrik Daya Maksimum10 MW', 'Jasa pelaksana instalasi dan perawatan elektromekanik daninstalasi kelistrikanpembangkit tenaga listrik dengan daya maksimum 10 MW / unit.'),(34, 'C', 'EL003', 'Jasa Pelaksana KonstruksiInstalasi Pembangkit Tenaga Listrik Energi Baru Dan Terbarukan', 'Jasa pelaksana instalasi dan perawatan pembangkit tenaga listrikenergi baru dan terbarukan antara lain : surya, angin (bayu), micro hydro, gelombang laut.'),(35, 'C', 'EL004', 'Jasa Pelaksana Konstruksi Instalasi JaringanTransmisi Tenaga Listrik Tegangan Tinggi/Ekstra Tegangan Tinggi', '1.   Jasa pelaksana instalasi dan perawatan jaringan transmisi tenaga listrik tegangan    tinggi /ektra tegangan tinggi termasuk instalasi gardu induk; dan2.   Jasa pelaksana instalasi dan perawatan jaringan transmisitenaga listrik dibawah    atau diatas tanah dan dibawah lautan.'),(36, 'C', 'EL005', 'Jasa Pelaksana Konstruksi Jaringan Transmisi Telekomunikasi dan/atau Telepon', '1.   Jasa pelaksana instalasi dan perawatan jaringan transmisi telekomunikasi dan atau telepon diatas permukaan tanah, termasuk pekerjaan untuk menara transmisi telekomunikasi; dan2.   Jasa pelaksana instalasi dan perawatan jaringan transmisitelekomunikasi dan atau telepondibawah tanah atau dibawah lautan.'),(37, 'C', 'EL006', 'Jasa PelaksanaKonstruksiJaringan Distribusi Tenaga Listrik Tegangan Menengah', 'Jasa pelaksana instalasi dan perawatan jaringan distribusi tenagalistrik tegangan menengah, termasuk untuk jalur listrik kereta api, instalasi listrik gardu hubung dan gardu-gardu distribusi.'),(38, 'C', 'EL007', 'Jasa Pelaksana Konstruksi Instalasi JaringanDistribusi Tenaga Listrik Tegangan Rendah', 'Jasa pelaksana instalasi dan perawatan jaringan distribusi tenaga listrik tegangan rendah danpenerangan jalan umum.'),(39, 'C', 'EL008', 'Jasa PelaksanaKonstruksi Instalasi Jaringan Distribusi Telekomunikasi dan/atau Telepon', '1.   Jasa pelaksana instalasi dan perawatan jaringan distribusitelekomunikasi dan/atau telepontermasuk jasa pelaksana untuk menara distribusitelekomunikasi;2.   Jasa Pelaksana instalasi dan perawatan stasiun telekomunikasi dan antenauntuk distribusi telekomunikasi;dan3.   Jasa Pelaksana instalasi dan perawatan untuk jalur kabel televise untuk dibawahpermukaan tanah.'),(40, 'C', 'EL009', 'Jasa PelaksanaKonstruksiInstalasi Sistem Kontrol dan Instrumentasi', 'Jasa pelaksana pemasangan instalasi kontrol dan instrumentasiuntuk sistempengendali tenaga listrik.'),(41, 'C', 'EL010', 'Jasa Pelaksana Konstruksi Instalasi TenagaListrik Gedung dan Pabrik', '1.   Jasa pelaksanan instalasi dan perawatan listrik di dalam dan diluar gedung, pabrik maupunjaringan konstruksi;2.   Jasa pelaksana instalasi dan perawatan listrik dan peralatan untuk sistem tenaga  listrikdarurat;3.   Jasa pelaksana instalasi dan perawatan alat pembatas daya listrik dan meteran listrik;4.   Jasa pelaksana instalasi dan perawatan alarm kebakaran;5.   Jasa pelaksana instalasi dan perawatan alarm pencurian;6.   Jasa pelaksana instalasi danperawatan antena segala Macam type antenna  termasuk antena satelit dan jalur televisi kabel didalam gedung;7.   Jasa pelaksana instalasi dan perawatan penangkal petir; dan8.   Jasa pelaksana instalasi dan perawatan listrik Khusus sepertiinstalasi listrik kapal,     instalasiListrik tahan api dan sejenisnya.'),(42, 'C', 'EL011', 'Jasa Pelaksana Konstruksi Instalasi Elektrikal Lainnya', 'Jasa pelaksana pemasangan dan perawatan untuk sistem penerangan dan tanda untuk jalan, rel kereta api, bandara, pelabuhan dan sejenis.'),(43, 'D', 'PL001', 'Jasa PenyewaanAlat Konstruksi danPembongkaranBangunan atauPekerjaan SipilLainnya denganOperator', 'Jasa peminjaman dan penyewaan yang berhubungan denganperalatan dengan operator untuk konstruksi atau penghancuran dan jasa operasional yang disediakan dengan operator.'),(44, 'D', 'PL002', 'Jasa PelaksanaPerakitan dan Pemasangan Konstruksi Prafabrikasi untuk Konstruksi BangunanGedung', 'Pekerjaan khusus pemasangan bangunan konstruksi prafabrikasiyang langsung dilakukan di lokasikonstruksi yang bahan utamanya dari beton untuk beberapa bagianpracetak dari bangunan gedung kecuali pekerjaan pemasangan komponen pracetak baja.'),(45, 'D', 'PL003', 'Jasa Pelaksana Perakitan dan PemasanganKonstruksi Prafabrikasi untuk Konstruksi Jalan dan JembatanSerta Rel KeretaApi', 'Pekerjaan khusus pemasangan bangunan konstruksi prafabrikasi yang langsung dilakukan di lokasikonstruksi yang bahan utamanya dari beton untuk beberapa bagian pracetak dari konstruksi jalan, jembatan dan rel kereta api kecualipekerjaan pemasangan komponen pracetak baja.'),(46, 'D', 'PL004', 'Jasa Pelaksana Perakitan dan Pemasangan Konstruksi Prafabrikasi untuk Konstruksi PrasaranaSumber Daya Air, Irigasi, Dermaga,Pelabuhan, Persungaian, Pantai serta BangunanPengolahan Air Bersih, Limbah dan Sampah (Insinerator)', 'Pekerjaan khusus pemasangan bangunan konstruksi prafabrikasi yang langsung dilakukan dilokasi konstruksi yang bahan utamanya dari beton untuk beberapa bagian pracetak dari konstruksi prasarana sumber daya air, irigasi, dermaga, pelabuhan, persungaian, pantai serta bangunan pengolahan air bersih dan limbah, kecuali pekerjaan pemasangan komponen pracetak baja.'),(47, 'E', 'SP001', 'Pekerjaan Penyelidikan Lapangan', 'Pekerjaan penyelidikan lapangan bertujuan mengidentifikasi lokasi yang tepat untuk proyekkonstruksidan untuk pekerjaan demarkasi, contohnya demarkasi dari suatu area lokal dimana satu atau lebih tahapan atau prosesbesar dari pekerjaan konstruksi sedang berjalan.'),(48, 'E', 'SP002', 'PekerjaanPembongkaran', 'Pekerjaan penghancuran bangunan atau struktur lainnyaseperti jalan dan jalan layang,mencakup juga penjualan material yang didapat dari hasil operasipenghancuran.'),(49, 'E', 'SP003', 'PekerjaanPenyiapan danPematanganTanah/Lokasi', 'Pekerjaan penyiapan yang bertujuan agar lahan siap untukdipergunakan untuk pekerjaan konstruksi selanjutnya, termasuk didalamnya blasting, testdrilling, dan pekerjaan pemindahan batu-batuan.'),(50, 'E', 'SP004', 'Pekerjaan Tanah, Galian dan Timbunan', 'Pekerjaan penggalian dan penimbunan, pekerjaan pemindahan tanah, grading of construction sites, trench digging.'),(51, 'E', 'SP005', 'Pekerjaan Persiapan Lapangan untukPertambangan', 'Pekerjaan terowongan dan pembangunan lainnya serta pekerjaan persiapan untuk propertimineral dan situsnya, kecuali untuk minyak dan gas. Contohnya pelayanan insidental konstruksi untuk pertambangan minyak dangas'),(52, 'E', 'SP006', 'PekerjaanPerancah', 'Pemasangan perancah bangunan dan pekerjaan dismantling.'),(53, 'E', 'SP007', 'Pekerjaan Pondasi, Termasuk Pemancangannya', 'Pekerjaan konstruksi khusus pondasi dan pekerjaan pile driving serta pekerjaan lain yang berkaitan.'),(54, 'E', 'SP008', 'Pekerjaan Pengeboran Sumur Air TanahDalam.', 'Pekerjaan konstruksi khusus yang melibatkan pengeboran dan penggalian sumber air, instalasi danpekerjaan perbaikan dari pompa sumur dan system pemipaan.'),(55, 'E', 'SP009', 'Pekerjaan Atap dan Kedap Air(waterproofing)', 'Pekerjaan konstruksi khusus yang melibatkan instalasi atap, gutteringdan spouting, roof shingling danpekerjaan atap metal. Pekerjaan pengecatan atap, termasukdidalamnya pekerjaan water- proofing untuk bangunan.'),(56, 'E', 'SP010', 'Pekerjaan Beton', 'Pekerjaan konstruksi khusus yang melibatkan pembetonan, concretepouring dan pekerjaan concretelainnya termasuk didalamnya aspal dan semen portland pada proyek konstruksi'),(57, 'E', 'SP011', 'Pekerjaan Baja dan Pemasangannya,TermasukPengelasan', 'Pekerjaan konstruksi khusus yang meliputi penekukan baja, pekerjaan konstruksi terhadap rangka baja,pekerjaan pemasangan komponen bajauntuk bangunan ataupun untuk struktur lain seperti jembatan, crane yang bekerja pada ketinggian,menara transmisi listrik serta pekerjaan reinforcing baja baik yang dibeli atau diproduksi sendiri termasuk juga pekerjaanpengelasan baja.'),(58, 'E', 'SP012', 'PekerjaanPemasangan Batu', 'Pekerjaan konstruksi khusus yang melibatkan pemasangan blok batu,pengesetan batu dan pekerjaan batu lainnya.'),(59, 'E', 'SP013', 'PekerjaanKonstruksiKhusus Lainnya', 'Pekerjaan konstruksi khusus lain seperti penggalian kuburan danperpindahan rumah'),(60, 'E', 'SP014', 'Pekerjaan Pengaspalan denganRangkaianPeralatan Khusus', 'Pekerjaan Pengaspalan dengan menggunakan peralatan produksi campuran aspal termasuktransportasi hasil campuran aspal hingga penggelaran dan pemadatan dengan peralatan khusus di lokasi pekerjaan.'),(61, 'E', 'SP015', 'PekerjaanLansekap/Pertamanan', 'Pekerjaan khusus pembuatan taman, seperti taman kota, tanaman dan pohon pelindung jalan.'),(62, 'E', 'SP016', 'PekerjaanPerawatan Bangunan Gedung', 'Pekerjaan pemeliharaan bangunan gedung, tidak termasuk pekerjaanyang melakukan perubahanterhadap struktur bangunan.'),(63, 'F', 'KT001', 'Pekerjaan Kaca dan Pemasangan Kaca Jendela', 'Pekerjaan konstruksi khusus material kaca, cermin, danproduk- produk berbahan kaca, sertapekerjaan instalasi jendela kaca.'),(64, 'F', 'KT002', 'PekerjaanPlesteran', 'Pekerjaan konstruksi khususdari plester interior dan exteriorataustucco dan pekerjaan dry wall yang berhubungan deingan instalasi dinding papan, yang biasanya adalah bahan gypsum.'),(65, 'F', 'KT003', 'PekerjaanPengecatan', 'Pekerjaan konstruksi khusus pengecatan dan pekerjaan konstruksi yangberhubungan dengan interior danexterior bangunan dan pekerjaan pengecatan dari struktur berat (rekayasa teknik). Tidak termasuk pengecatan atap bangunan.'),(66, 'F', 'KT004', 'Pekerjaan Pemasangan Keramik Lantai danDinding', 'Pekerjaan konstruksi khusus pemasangan dan pegesetan keramik, dinding beton, dindingpotongan batu, serta lantai ubin.'),(67, 'F', 'KT005', 'PekerjaanPemasanganLantai Lain, Penutupan Dinding danPemasangan Wallpaper', 'Pekerjaan konstruksi khusus pemasangan karpet, linoleum, ubinaspal, lantai elastis, parquet, dan lantai berbahan kayu keras lainnya.'),(68, 'F', 'KT006', 'Pekerjaan Kayu dan ataupenyambungan Kayu dan Material Lain', 'Pekerjaan konstruksi khusus yang berhubungan dengan pekerjaanpengrajin kayu, pembentukan bentuk kayudanpemasanganlemari di lokasi konstruksi.'),(69, 'F', 'KT007', 'Pekerjaan Dekorasi dan Pemasangan Interior', 'Pekerjaan konstruksi khusus pemasangan terazzo, interior marbel, granit dan pekerjaan batu tulis.'),(70, 'F', 'KT008', 'Pekerjaan Pemasangan Ornamen', 'Pekerjaan konstruksi khusus untuk komponen logam lembaran fabrikasi khusus, pekerjaan dekorasi besidan baja, serta pengerjaan ornament dan arsitektur logam.'),(71, 'F', 'KT009', 'Pekerjaan Pemasangan Gipsum', 'Pekerjaan konstruksi khusus untuk komponen panel gypsum sepertipemasangan dinding partisi dalambangunan gedung yang menggunakan panel gypsum,pemasangan plafon dalam bangunan gedung yang menggunakan panel gypsum.'),(72, 'F', 'KT010', 'PekerjaanPemasangan plafon akustik (accoustic ceiling)', 'Pekerjaan konstruksi khusus untuk pemasangan plafon akustik padaruangan di dalam bangunangedung. Bahan penutup plafond akustik berbentuk panel yangdiletakkan atau dijepit pada rangka metal yang bentuk grid (kotak-kotak).'),(73, 'F', 'KT011', 'Pemasangancurtain wall', 'Pekerjaan konstruksi khusus untuk menutup sisi-sisi bagian luar gedung bertingkat. Bahan penutup bangunan merupakan bahan non struktural dan ringan, yang berfungsi sebagai pemisah antara bagian dalam dan luar gedung. Pemasangan curtain wall padaumumnya terdiri dari rangka allumunium dan bahan penutupberupa kaca, panel metal atau GRC (Glassfibre Reinforce Concrete).'),(74, 'G', 'AR101', 'Jasa Nasehat dan Pra Desain Arsitektural', 'Jasa asistensi, nasehat, dan rekomendasimengenai arsitektural dan hal-hal yang terkait dengan arsitektural. Termasuk didalamnya melaksanakan kajian pendahuluan tentang isu- isu seperti site philosopi, tujuan dari pembangunan, tinjauan lingkungan dan iklim, kebutuhan hunian, batasan biaya, analisa pemilihan lokasi, penjadwalan pelaksanaan konstruksi, dan isu lain yang mempengaruhi desain dan konstruksi dari suatu proyek. Jasa ini meliputi tidak hanya proyek konstruksi yang baru namun dapat meliputi nasihat mengenai metode dalam melaksanakan perawatan,renovasi, restorasi, atau recycling dari bangunan, atau penentuan nilai dan kualitas dari bangunanatau nasihat arsitektural lainnya.'),(75, 'G', 'AR102', 'Jasa Desain Arsitektural', 'Jasa desain arsitektural untuk bangunan danstruktur lainnya, dapat meliputi satu atau kombinasi dari kegiatan sebagai berikut:1.    Jasa desain skematik yang meliputi penentuan (bersama dengan klien) batasananggaran dan penjadwalan waktu; serta menyiapkan sketsa yang     meliputi floor plans, site plans, dan exterior views;2.    Jasa desain pembangunan yang meliputiilustrasi presisi dari konsep desain     dalam hal siting plan, bentuk dan material yang akan digunakan, struktur, sistem mekanikal dan elektrikal, dan kemungkinan biaya konstruksi; dan3.    Jasa desain akhir yang meliputi spesifikasi tertulis dan gambar yang cocok untuk digunakan sebagai detail dari pelaksanaantender dan konstruksi, dan juga nasihat ahli kepada klien pada saat evaluasi tender.'),(76, 'G', 'AR103', 'Jasa Penilai Perawatan dan Kelayakan Bangunan Gedung', 'Jasa penelitian, nasehat dan rekomendasi yangberkaitan dengan masalah arsitektural dan hal berikut:1.    cara untuk melaksanakan pemeliharaan bangunan, renovasi gedung, dan jasarestorasi bangunan gedung;2.    penilaian kelayakan bangunan gedung termasuk juga didalamnya bangunan yang terkena musibah kebakaran;3.    tata cara penilaian usia bangunan; dan4.    tatacara pembongkaran (demolisi) bangunan gedung Tidak berkaitan dengan proyek konstruksi baru dan penambahan bangunan baru.'),(77, 'G', 'AR104', 'Jasa Desain Interior', '1.    Jasa desain interior seperti perencanaan danperancangan ruangan interior untuk kebutuhan fisik, estetik dan fungsi;2.    Penggambaran desain untuk dekorasiinterior; dan3.    Dekorasi interior termasuk penyempurnaan jendela dan gudang.'),(78, 'G', 'AR105', 'Jasa Arsitektur lainnya', 'Semua jasa yang membutuhkan keahlian arsitekseperti penyiapan promotional material dan presentasi, serta as built drawings. Termasuk juga sebagai representasi lapangan saat fasekonstruksi, pembuatan manual operasi dan lain sebagainya.'),(79, 'H', 'RE101', 'Jasa Nasehat dan Konsultansi RekayasaTeknik', 'Rekomendasi, nasihat dan asistensi mengenairekayasa teknik, termasuk didalamnya melaksanakan studi kelayakan dan dampak dari proyek contohnya antara lain:1.    studi dampak topografi dan geologi dalam desain, konstruksi dan biaya dari jalan, saluran pipa dan infrastruktur transportasi lainnya;2.    Studi dari kualitas atau kecocokan materialyang akan digunakan dalam proyek konstruksi dan dampaknya dalam desain, serta konstruksi dan biaya jika menggunakan material yang berbeda;3.    Studi dampak lingkungan dari proyek konstruksi; dan4.    Studi keuntungan efesiensi produksi sebagai dampak dari penggunaan alternativeproses, teknologi dan lay out.Ruang lingkup dari jasa ini tidak selalu terkait dengan proyek konstruksi namun dapat juga meliputi penilaian dari struktur bangunan dan instalasi mekanikal dan elektrikal, testimoni ahli dalam kasus litigation serta memberikan asistensi kepada pemerintah dalam penyusunan peraturan perundangan.'),(80, 'H', 'RE102', 'Jasa Desain Rekayasa untuk Konstruksi Pondasi serta Struktur Bangunan', 'Jasa desain rekayasa struktur untuk the loadbearing framework dari bangunan perumahan dan komersial, bangunan institusi dan industrial. Jasa desain ini meliputi satu atau kombinasi dari kegiatan berikut:1.    Estimasi biaya, spesifikasi dan rencana pendahuluan untuk mendefinisikan konsep desain teknik;2.    Rencana akhir, spesifikasi dan estimasibiaya termasuk didalamnya gambar kerja, spesifikasi material yang digunakan, metode instalasi, batasan waktu dan  spesifikasiyang dibutuhkan untuk keperluan tender dan konstruksi serta nasihat ahli untuk klientpada saat evaluasi dan penerimaan tender;dan3.    Jasa yang diberikan pada saat fase konstruksi.'),(81, 'H', 'RE103', 'Jasa Desain Rekayasa untuk PekerjaanTeknik Sipil Air', 'Jasa pembuatan desain rekayasa (engineering)untuk pekerjaan rekayasa sipil keairan seperti dam, catchment basins, sistem irigasi, pekerjaan pengendalian banjir, pelabuhan, pekerjaanpenyaluran air dan sanitasi serta sistem saluran air limbah industri. Jasa Desain meliputi salah satu dari kombinasi layanan berikut: perencanaan awal, estimasi biaya dan spesifikasi dalamrangka menterjemahkan konsep desain teknis; perencanaan akhir, estimasi biaya dan spesifikasi termasuk gambar teknik, spesifikasi material yang akan digunakan, metode pemasangan, batasan waktu dan spesifikasi teknis lainnyayang dibutuhkan untuk keperluan tender; layanan pada saat fase konstruksi.'),(82, 'H', 'RE104', 'Jasa Desain Rekayasa untuk Pekerjaan Teknik Sipil Transportasi', 'Jasa pembuatan desain rekayasa (engineering)untuk pekerjaan rekayasa sipil transportasi seperti jembatan, jalan layang, dan jalan raya. Jasa Desain meliputi salah satu dari kombinasilayanan berikut: perencanaan awal, estimasi biaya dan spesifikasi dalam rangka menterjemahkan konsep desain teknis, perencanaan akhir, estimasi biaya dan spesifikasitermasuk gambar teknik, spesifikasi material yang akan digunakan, metode pemasangan, batasan waktu dan spesifikasi teknis lainnya yang dibutuhkan untuk keperluan tenderlayanan pada saat fase konstruksi. Termasuk didalamnya jasa pembuatan desain structural health monitoring system untuk bentang jembatan.'),(83, 'H', 'RE105', 'Jasa Desain Rekayasa untuk PekerjaanMekanikal dan Elektrikal Dalam Bangunan', 'Jasa pembuatan desain rekayasa (engineering)mekanikal dan elektrikal untuk system energi, sistem penerangan, sistem alarm kebakaran,sistem komunikasi dan sistem eletrikal lainnyauntuk semua jenis bangunan dan atau sistem pemanas ruangan, ventilasi, pendingin ruanganlemari pendingin dan pemasangan mekanikal lainnya untuk semua jenis bangunan. Jasa Desain meliputi salah satu dari kombinasi layananberikut : perencanaan awal, estimasi biaya danspesifikasi dalam rangka menterjemahkan konsep desain teknis; perencanaan akhir, estimasi biaya dan spesifikasi termasuk gambarteknik, spesifikasi material yang akan digunakan, metode pemasangan, batasan waktu danspesifikasi teknis lainnya yang dibutuhkan untuk keperluan tender layanan pada saat fase konstruksi.'),(84, 'H', 'RE106', 'Jasa Desain Rekayasa untuk Proses Industrial dan Produksi', 'Jasa desain teknik untuk proses produksi,prosedur dan fasilitas produksi. Termasuk didalamnya jasa desain yang berkaitan dengan produksi metode pemotongan, handling dantransportasi logistik dan lay out lokasi antara lain lay out pembangunan pertambangan dan dan konstruksi bawah tanah, gabungan pelaksanaan sipil, instalasi mekanikal dan elektrikal lokasipertambangan bawah tanah termasuk didalamnya hoists, kompresor, stasiun pompa, crushers, conveyor dan sistem handling limbah, prosedur recovery dari minyak dan  gas, konstruksi, instalasi dan perawatan dari peralatanpengeboran, fasilitas penyimpanan. Jasa desain meliputi satu atau kombinasi dari beberapa kegiatan antara lain:1.    Estimasi biaya, spesifikasi dan rencana pendahuluan untuk mendefinisikan konsep desain teknik;2.    Rencana akhir, spesifikasi dan estimasibiaya termasuk didalamnya gambar kerja,   spesifikasi material yang digunakan, metode instalasi, batasan waktu dan spesifikasi   yangdibutuhkan untuk keperluan tender dan konstruksi serta nasihat ahli untukklien  pada saat evaluasi dan penerimaan tender; dan3.    Jasa yang diberikan saat fase konstruksi.'),(85, 'H', 'RE107', 'Jasa Nasehat dan Konsultansi JasaRekayasa Konstruksi', 'Jasa konsultansi di bidang jasa konstruksi yangmeliputi jasa nasihat dalam pembinaan usaha dan kelembagaan, pembinaan penyelenggaraan dan pembinaan investasi konstruksi serta pembinaankompetensi dan keahlian Tenaga Kerja Konstruksi oleh Pemerintah baik Pemerintah Pusat maupun Pemerintah Daerah. Termasuk jasa penelitian dan pengembangan bidangkonstruksi.'),(86, 'H', 'RE108', 'Jasa Desain Rekayasa Lainnya', 'Jasa desain rekayasa khusus lainnya. Termasukdesain rekayasa akustik dan vibrasi, sistem pengendalian lalu-lintas, pengembangan prototype dan desain detail dari produk baru serta jasa desain rekayasa khusus lainnya.'),(87, 'I', 'PR101', 'Jasa Perencanaan dan Perancangan Perkotaan', 'Jasa perencanaan tata ruang (mencakup darat,laut, udara, dan di dalam bumi) perkotaan,jasa perancangan bagian perkotaan, termasuk jugajasa pengkajian dan jasa penasehatan dalam penataan ruang perkotaan.'),(88, 'I', 'PR102', 'Jasa Perencanaan Wilayah', 'Jasa perencanaan tata ruang (mencakup darat,laut, udara, dan di dalam bumi) wilayah nasional, pulau, provinsi, kabupaten, dan kota, termasuk juga jasa pengkajian dan jasa penasehatan dalampenataan ruang wilayah yang didalamnya dapat meliputi kawasan koridor pulau, kawasan strategis nasional/provinsi/kabupaten/kota, kawasan andalan dan kawasan permukimantermasuk ruang terbuka publik/terbuka hijau.'),(89, 'I', 'PR103', 'Jasa Perencanaan dan Perancangan lingkungan bangunan dan lansekap', 'Jasa pembuatan desain dan rencana dari aestheticlandscaping untuk taman, lahan komersial dan permukiman. Meliputi penyiapan rencana lapangan, gambar kerja,spesifikasi dan estimasi biaya untuk pengembangan lahan yang menggambar kan kontur tanah, tanaman yang akan ditanam, dan fasilitas lain seperti tempat pejalan kaki, pagar,dan area parkir. Termasuk juga didalamnyajasa inspeksi dari pekerjaan selama konstruksi,jasa pengkajian dan penasehatanpenataan lingkungan bangunan dan lansekap.'),(90, 'I', 'PR104', 'Jasa PengembanganPemanfaatan Ruang', 'Jasa perumusan kebijakan strategis operasionalrencana tata ruang(mencakup darat,laut, udara, dan di dalam bumi), jasa pemrograman pemanfaatan ruang perkotaan,wilayah, kawasan/ lingkungan, termasuk juga jasa manajemen mitigasi dan adaptasi bencana dan kerusakan lingkungan, fasilitasi kemitraan dan pelembagaan dalam penyelenggaraanpenataan ruang.'),(91, 'J', 'AR201', 'Jasa PengawasAdministrasi Kontrak', 'Jasa asistensi teknis dan nasihat selama fasekonstruksi untuk memastikan struktur terbangun sama dengan gambar teknis final beserta spesifikasinya. Jasa ini meliputi jasa yang disediakan baik di kantor maupun di lapangan seperti inspeksi teknis konstruksi, penyiapan laporan kemajuan, penerbitan sertifikat untuk pembayaran ke penyedia jasa pelaksana konstruksi, memberikan panduan kepada penyedia jasa dan/atau pengguna jasa dalam hal interpretasi terhadap dokumen kontrak dan jasa nasihat lain dalam aspek teknikal selama proses konstruksi.Termasuk didalamnya juga jasa yang diberikan setelah selesainya proses konstruksi yang meliputi penilaian pada konstruksi dan instruksi mengenai koreksi pengukuran yang harus dilakukan selama periode 12 bulan setelah selesainya proses konstruksi.'),(92, 'K', 'RE201', 'Jasa PengawasPekerjaan KonstruksiBangunan Gedung', 'Jasa asistensi teknis dan nasihat selama fasepelaksanaan konstruksi bangunan gedung untuk memastikan pekerjaan konstruksi yang sedang dilaksanakan sudah sesuai dengan final desain.Meliputi jasa yang diberikan di kantor maupun di lapangan seperti pengkajian shop drawings, kunjungan secara periodik ke lapangan untuk mengukur progress dan kualitas pekerjaan,memberikan panduan kepada klien dan penyedia jasa pelaksana konstruksi dalam menginterpretasikan dokumen kontrak dan nasihat lain dalam hal teknikal selama proses kontruksi bangunan gedung.'),(93, 'K', 'RE202', 'Jasa PengawasPekerjaan KonstruksiTeknik SipilTransportasi', 'Jasa asistensi teknis dan nasihat selama fasepelaksanaan konstruksi infrastruktur sipil transportasi seperti jalan raya, jembatan, jalanbebas hambatan dan sebagainya untukmemastikan pekerjaan konstruksi yang sedang dilaksanakan sudah sesuai dengan final desain.Meliputi jasa yang diberikan di kantor maupun di lapangan seperti pengkajian shop drawings, kunjungan secara periodik ke lapangan untuk mengukur progress dan kualitas pekerjaan,memberikan panduan kepada klien dan kontraktor dalam menginterpretasi kan dokumen kontrak dan nasihat lain dalam hal teknikal selama proses kontruksi infrastruktur sipiltransportasi.'),(94, 'K', 'RE203', 'Jasa PengawasPekerjaan KonstruksiTeknik Sipil Air', 'jasa asistensi teknis dan nasihat selama fasepelaksanaan konstruksi infrastruktur sipil keairan seperti dam, catchment basins, sistem irigasi, pekerjaan pengendalian banjir, pelabuhan, pekerjaan penyaluran air dan sanitasi serta sistem saluran air limbah industri, untuk memastikan pekerjaan konstruksi yang sedang dilaksanakan sudah sesuai dengan final desain . Meliputi jasa yang diberikan di kantor maupun di lapangan seperti pengkajian shop drawings, kunjungan secara periodik kelapangan untuk mengukur progres dan kualitas pekerjaan, memberikan panduan kepada klient dan kontraktor dalam menginterpretasikan dokumen kontrak dan nasihat lain dalam hal teknikal selama proses kontruksi infrastruktur sipil keairan.'),(95, 'K', 'RE204', 'Jasa PengawasPekerjaan Konstruksi dan Instalasi Proses dan Fasilitas Industri', 'jasa asistensi teknis dan nasihat selama fasepelaksanaan konstruksi dan instalasi proses dan fasilitas industri untuk memastikan pekerjaan konstruksi yang sedang dilaksanakan sudahsesuai dengan final desain, meliputi kunjungan secara periodik ke lapangan untuk mengukur progres dan kualitas pekerjaan.'),(96, 'L', 'PR201', 'Jasa Pengawas danPengendali PenataanRuang', 'Jasa pengawasan teknis penyelenggaraanpenataan ruang, jasa audit pemanfaatan ruang,dan pengaturan zonasi, termasuk juga jasa pengkajian dan penasehatan dalampengawasandan pengendalian penataan ruang.'),(97, 'M', 'SP301', 'Jasa PembuatanProspektus Geologi dan Geofisika', 'Jasa konsultansi geologi, geofisika dan geokimia yang berhubungan dengan kandungan mineral, minyak dan gas serta air bawah tanah dengan melakukan studi parameter terhadapbumi dan formasi batu dan struktur.'),(98, 'M', 'SP302', 'Jasa Survey bawahTanah', 'Jasa pengambilan data pada formasi dibawahpermukaan bumi denganmetode lainnya termasuk didalamnya pengukuran seismograf, gravimeter,magnetometer, dan metode survey bawahpermukaan lainnya.'),(99, 'M', 'SP303', 'Jasa SurveyPermukaan Tanah', 'Jasa pengambilan informasi dari bentuk posisidan/atau lapisan dari permukaan bumi dengan menggunakan metode lain, termasuk transit,fotogrametri dan survey hydrografi untuk tujuan persiapan pembuatan peta.'),(100, 'M', 'SP304', 'Jasa Pembuatan Peta', 'Terdiri dari perisapan dan revisi dari segala jenispeta (jalan, cadastral,topografi, dan planimeter).'),(101, 'M', 'SP305', 'Jasa Pengujian danAnalisa Komposisi dan Tingkat kemurnian', 'Jasa pengujian dan analisa dari parameter kimiadan biologi material seperti udara, air, dan limbah (limbah rumah tangga dan industri), minyak, metal, mineral dan zat kimia. Termasuk didalamnya jasa pengujian dan analisa yang berhubungan dengan mikrobiologi, biokimiawi, bakteriologi, dan sebagainya.'),(102, 'M', 'SP306', 'Jasa Pengujian danAnalisa Parameter fisikal', 'Jasa pengujian dan analisa parameter fisikalseperti kekuatan, keringkihan, konduktivitas elektriksitas dan radioaktivitas dari material seperti metal, plastik, tekstil, kayu,kaca, beton, dan material lainnya. Termasuk didalamnya pengujian daya tarik, kekerasan, impact resistance, ketahanan fatique, serta efek temperatur tinggi.'),(103, 'M', 'SP307', 'Jasa Pengujian danAnalisa SistemMekanikal danElektrikal', 'Jasa Pengujian dan analisa dari karakteristikpermesinan lengkap, motor,mobil, peralatan dan penerapan, peralatan komunikasi, dan peralatan lainnya yangberhubungan dengan mekanikal dan elektrikal.'),(104, 'M', 'SP308', 'Jasa Inspeksi Teknikal', 'Jasa Pengujian dan Analisa dari teknikal yangtidak mempengaruhi objek yang dilakukan pengujian, Termasuk didalamnya radiografi,magnetic, dan pengujian ultrasonic darikomponen mesin dan struktur yang dilakukan untuk mengidentifikasi cacat produk. Pengujianini dilakukan langsung di lapangan.'),(105, 'N', 'KL401', 'Jasa KonsultansiLingkungan', 'Jasa konsultansi yang mencakup kegiatanpengolahan air bersih, penyehatan lingkungan permukiman, serta nasihat pengelolaan persampahan.'),(106, 'N', 'KL402', 'Jasa KonsultansiEstimasi Nilai Lahan dan Bangunan', 'Jasa konsultansi yang dengan metode tertentumelakukan estimasi terhadap nilai dari suatu lahan dan/atau bangunan (baik bangunan gedungmaupun bangunan sipil). Termasuk didalamnya memberikan rekomendasi perencanaan pembebasan lahan untuk proyek konstruksi.'),(107, 'N', 'KL403', 'Jasa Manajemen Proyek TerkaitKonstruksi Bangunan', 'Jasa konstruksi menyeluruh di bidang sipilbangunan gedung antara bangunan hunian, dan bangunan bukan hubian seperti bangunanindustri, pertanian dan komersial, dimana tanggungjawab atas keberhasilan penyelesaian proyek atas nama pengguna jasa (klien), termasuk didalamnya pengorganisasian pembiayaan dan desain, undangan tender, danpelaksanaan manajemen termasuk fungsi-fungsi kontrol.'),(108, 'N', 'KL404', 'Jasa Manajemen Proyek Terkait Konstruksi Pekerjaan Teknik SipilTransportasi', 'Jasa konstruksi menyeluruh di bidang sipiltransportasi antara lain jalan bebas hambatan, jalan raya, jalan, jalan kereta api, landasan pacu pesawat, jembatan, jalan layang, terowongan danjalan bawah tanah, dimana tanggungjawab atas keberhasilan penyelesaian proyek atas nama pengguna jasa (klien), termasuk didalamnya pengorganisasian pembiayaan dan desain,undangan tender, dan pelaksanaan manajemen termasuk fungsi-fungsi kontrol.'),(109, 'N', 'KL405', 'Jasa ManajemenProyek Terkait Konstruksi Pekerjaan Teknik Sipil Keairan', 'Jasa konstruksi menyeluruh di bidang sipilkeairan antara lain pelabuhan,saluran air, bendungan, irigasi dan pekerjaan air lainnya dimana tanggungjawab atas keberhasilanpenyelesaian proyek atas nama pengguna jasa (klien), termasuk didalamnya pengorganisasian pembiayaan dan desain, undangan tender, dan pelaksanaan manajemen termasuk fungsi-fungsikontrol.'),(110, 'N', 'KL406', 'Jasa ManajemenProyek Terkait Konstruksi Pekerjaan Teknik Sipil Lainnya', 'Jasa konstruksi menyeluruh di bidang sipillainnya antara lain pemipaan, kabel komunikasi dan listrik, jarak jauh, pemipaan lokal dan kabel dan pekerjaan yang terkait olahraga outdoor dan fasilitas rekreasi dimana tanggungjawab atas keberhasilan penyelesaian proyek atas nama pengguna jasa (klien), termasuk didalamnya pengorganisasian pembiayaan dan desain, undangan tender, dan pelaksanaan manajemen termasuk fungsi-fungsi kontrol.'),(111, 'N', 'KL407', 'Jasa ManajemenProyek Terkait Konstruksi Pekerjaan konstruksi prosesdan fasilitas industrial', 'Jasa konstruksi menyeluruh di bidang konstruksiindustri dan proses antara lain pertambangan, konstruksi pembangkit tenaga listrik, kimia dan fasilitas terkait, konstruksi untuk manufaktur,dan otomasi proses industri dimana tanggungjawab atas keberhasilan penyelesaian proyek atas nama pengguna jasa (klien), termasuk di dalamnya pengorganisasianpembiayaan dan desain, undangan tender, dan pelaksanaan manajemen termasuk fungsi-fungsi kontrol.'),(112, 'N', 'KL408', 'Jasa ManajemenProyek Terkait Konstruksi Pekerjaan Sistem Kendali LaluLintas', 'Jasa konstruksi menyeluruh di bidang sistemkontrol lalu lintas antara lain sistem kontrol lalu lintas untuk transportasi darat, udara dan laut dimana tanggungjawab atas keberhasilanpenyelesaian proyek atas nama pengguna jasa (klien), termasuk didalamnya pengorganisasian pembiayaan dan desain, undangan tender, dan pelaksanaan manajementermasuk fungsi-fungsi kontrol.'),(113, 'N', 'KL409', 'Jasa Rekayasa(Engineering) Terpadu', 'Jasa enjiniring terpadu untuk pembangunanproyek-proyek konstruksi denganlayanan yang diberikan secara terpadu meliputi:1.   perencanaan dan studi pra-investasi;2.   pembuatan desain awal dan desain final;3.   pembuatan estimasi biaya dan jadwal pelaksanaan proyek;4.   pelaksanaan inspeksi dan penerimaan pekerjaaan sesuai kontrak ; dan5.   pelayanan teknis, seperti pemilihan dan pelatihan personil dan penyediaan operasi serta pemeliharaan manual beserta jasa-jasa teknik lain yang diberikan kepada klien.Layanan enjiniring terpadu dapat diberikan untuk seluruh pekerjaan berikut:1.   Jalan bebas hambatan (highways), jalan raya(streets), jalan (roads), jalan kereta api, landas pacu pesawat;2.   Jembatan, jalan layang, terowongan danjalan bawah tanah;3.   Pelabuhan, saluran air, bendungan, irigasi dan pekerjaan air lainnya;4.   Pemipaan, kabel komunikasi dan jalur tenaga(power lines) jarak jauh;5.   Pemipaan lokal dan kabel dan pekerjaan yang terkait;6.   Fasilitas olah raga outdoor dan fasilitasrekreasi;7.   Konstruksi bangunan hunian dan bangunan bukan hunian seperti bangunan industri,komersial atau pertanian;8.   Industrial plant dan proses serta manufaktur;9.   Konstruksi pembangkit tenaga (power plant); dan10. 10. Bangunan modifikasi dari bangunandiatas.');
UNLOCK TABLES;
COMMIT;
